import React from "react";
import { View, Text, TouchableOpacity } from "react-native";
import { StyleSheet } from "react-native";
function HeaderTabs() {
  return (
    <View style={styles.container}>
      {/* Header Button */}
      {/* Header Button */}
      <HeaderButton btnColor="black" textColor="white" text="Delievry" />
      <HeaderButton btnColor="white" textColor="black" text="Pickup" />
    </View>
  );
}

const HeaderButton = (props) => {
  return (
    <View>
      <TouchableOpacity
        style={{
          backgroundColor: props.btnColor,
          paddingVertical: 6,
          paddingHorizontal: 16,
          borderRadius: 30,
          justifyContent: "space-between",
        }}
      >
        <Text>{props.text}</Text>
      </TouchableOpacity>
    </View>
  );
};

export default HeaderTabs;

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    alignSelf: "center",
  },
  deliveryBtn: {
    backgroundColor: "white",
    color: "black",
  },
  pickupBtn: {},
  headerButtons: {},
});
